### Approach
1. **Problem Analysis**: The problem requires checking if a binary tree is symmetric around its center. This means that the left subtree should be a mirror reflection of the right subtree.
2. **Intuition**: For the tree to be symmetric, the left child of the left subtree should match the right child of the right subtree, and vice versa. This can be checked recursively by comparing corresponding nodes.
3. **Algorithm Selection**: We use a recursive approach where we compare the left subtree of the left node with the right subtree of the right node, and the right subtree of the left node with the left subtree of the right node.
4. **Complexity Analysis**: The algorithm visits each node exactly once, leading to a time complexity of O(n), where n is the number of nodes in the tree. The space complexity is O(h) due to the recursion stack, where h is the height of the tree.

### Solution Code
```cpp
class Solution {
public:
    bool isSymmetric(TreeNode* root) {
        if (root == nullptr) return true;
        return isMirror(root->left, root->right);
    }

    bool isMirror(TreeNode* leftNode, TreeNode* rightNode) {
        if (leftNode == nullptr && rightNode == nullptr) return true;
        if (leftNode == nullptr || rightNode == nullptr) return false;
        return (leftNode->val == rightNode->val) 
            && isMirror(leftNode->left, rightNode->right) 
            && isMirror(leftNode->right, rightNode->left);
    }
};
```

### Explanation
1. **Base Case Handling**: If the root is `nullptr`, the tree is trivially symmetric.
2. **Mirror Check Function**: The helper function `isMirror` checks if two subtrees are mirrors of each other:
   - If both nodes are `nullptr`, they are mirrors.
   - If one is `nullptr` and the other is not, they are not mirrors.
   - Otherwise, check if their values are equal and recursively check if the left subtree of the left node mirrors the right subtree of the right node, and the right subtree of the left node mirrors the left subtree of the right node.
3. **Recursive Calls**: The function recursively checks each pair of corresponding nodes to ensure the entire tree is symmetric.

