    // 1. 题目要求：给定一个整数数组 nums 和一个整数 k，返回该数组所有大小为 k 的子数组中的最大值。
    // 2. 思路：使用单调队列（双端队列）来维护当前窗口中的最大值。队列中存储的是下标，且队头元素是当前窗口的最大值。
    // 3. 算法步骤：
    //    a. 初始化一个双端队列 deque 和结果数组 res。
    //    b. 遍历数组：
    //        i. 当队列非空且队头元素不在当前窗口内（即队头下标 <= i-k）时，弹出队头。
    //        ii. 从队尾开始，如果当前元素 nums[i] 大于等于队尾元素对应的值，则弹出队尾（因为队尾元素不可能成为最大值了）。
    //        iii. 将当前元素下标 i 加入队尾。
    //        iv. 当 i >= k-1 时（即窗口形成），将队头元素对应的值加入结果数组。
    // 4. 时间复杂度：O(n)，每个元素最多入队出队一次。
    // 5. 空间复杂度：O(k)，队列最多存储 k 个元素。

    public int[] maxSlidingWindow(int[] nums, int k) {
        if (nums == null || nums.length == 0 || k <= 0) {
            return new int[0];
        }
        int n = nums.length;
        int[] res = new int[n - k + 1];
        Deque<Integer> deque = new ArrayDeque<>(); // 存储下标

        for (int i = 0; i < n; i++) {
            // 移除不在窗口内的元素（队头）
            while (!deque.isEmpty() && deque.peekFirst() < i - k + 1) {
                deque.pollFirst();
            }
            // 从队尾开始，移除所有小于当前元素的元素，因为它们不可能是最大值
            while (!deque.isEmpty() && nums[deque.peekLast()] <= nums[i]) {
                deque.pollLast();
            }
            // 将当前元素下标加入队尾
            deque.offerLast(i);
            // 当窗口大小达到k时，记录结果
            if (i >= k - 1) {
                res[i - k + 1] = nums[deque.peekFirst()];
            }
        }
        return res;
    }
}
